import './App.css';
import Auth from "./components/Auth";
import { useUserContext } from "./context/userContext";
import Dashboard from "./components/Dashboard";
function App() {
  const { user } = useUserContext();

  return (
    <div className="App">
      {user ? <Dashboard /> : <Auth />}
    </div>
  );
}

export default App;
